import React from "react";
import './App.css';
import signIn from "./components/signIn";
import signUp from "./components/signUp";
import { Link } from "react-router-dom";


function App() {
  return (
    <div className="App">
      <header>
        <nav>
          <ul>
            <ul className="pgTitle"><li>Music App</li></ul>
            <ul className="menuul">
            <li>Home</li>
            <li>About</li>
            <li><Link to="/signup">Sign up</Link></li>
            <li><Link to="/signin">Sign in</Link></li>
            </ul>
          </ul>
        </nav>
      </header>
      <main>

      </main>
      <footer>main</footer>
    </div>
  );
}

export default App;
